import { useFlags, withLDProvider } from 'launchdarkly-react-client-sdk';
import HelloWorld from './helloWorld'; //We will add this code in the next step
import logo from './logo.svg'
import ldlogo from './launchdarkly-icon-logo.png'
import './App.css';
import Header from './components/header';

function App() {
  const { imageSwitch, bottomText, newHeader } = useFlags()
  return (
    <div className="App">
      <header className="App-header">
        {newHeader ? (<Header />): (<div />)}
        { imageSwitch ? (<img src={ldlogo} className="App-logo" alt="logo" />) :( <img src={logo} className="App-logo" alt="logo" />)

        }
        <p>
          {bottomText}
          hello my baby hello my darlin'
        </p>

        <HelloWorld />

      </header>
    </div>
  );
}
// Update the export default to use your environment-specific client ID and a sample context:
export default withLDProvider({
  clientSideID: '656eb3fa552c3c10556c5ecf',
  context: {
    "kind": "user",
    "key": "example_user2",
    "name": "Example user2",
    "email": "User2@example2.com"
  }
})(App);
